import React, { useState } from 'react';
import { FaChartBar, FaStar, FaMoneyBill, FaCalendarAlt } from 'react-icons/fa'; 

const Popup = () => {
  const [saldoTotal, setSaldoTotal] = useState('');
  const [descricao, setDescricao] = useState('');
  const [valor, setValor] = useState('');
  const [data, setData] = useState('');
  const [categoria, setCategoria] = useState('');

  const handleAdicionar = () => {
    // Lógica para adicionar os dados (pode ser implementada conforme necessário)
    // Aqui você pode usar os valores de saldoTotal, descricao, valor, data e categoria
    console.log('Adicionar lógica aqui:', saldoTotal, descricao, valor, data, categoria);
  };

  return (
    <div className="popup">
      <div className="popup-content">
        {/* Campos no popup */}
        <div className="saldo-total-input">
          <label htmlFor="saldoTotal">Saldo Total:</label>
          <input
            type="number"
            id="saldoTotal"
            value={saldoTotal}
            onChange={(e) => setSaldoTotal(e.target.value)}
          />
        </div>
        <div className="description-input">
          <label htmlFor="descricao">Gastos:</label>
          <input
            type="text"
            id="descricao"
            value={descricao}
            onChange={(e) => setDescricao(e.target.value)}
          />
        </div>
        <div className="value-input">
          <label htmlFor="valor">Valor:</label>
          <input
            type="number"
            id="valor"
            value={valor}
            onChange={(e) => setValor(e.target.value)}
          />
        </div>
        <div className="">
          <div className="date-input">
            <label htmlFor="data">Data:</label>
            <input
              type="date"
              id="data"
              value={data}
              onChange={(e) => setData(e.target.value)}
            />
          </div>
          <div className="category-input">
            <label htmlFor="categoria">Categoria:</label>
            <select
              id="categoria"
              value={categoria}
              onChange={(e) => setCategoria(e.target.value)}
            >
              <option value="">Selecione uma categoria</option>
              <option value="Conta de Luz">Conta de Luz</option>
              <option value="Conta de Telefone">Conta de Telefone</option>
              <option value="Conta de Água">Conta de Água</option>
              <option value="Contas de Casa">Contas de Casa</option>
              <option value="Gastos Emergenciais">Gastos Emergenciais</option>
              <option value="Compras">Compras</option>
            </select>
          </div>
        </div>
        <button onClick={handleAdicionar}>Adicionar</button>
      </div>
    </div>
  );
};

const Menu = () => {
  const [isPopupOpen, setIsPopupOpen] = useState(false);

  const togglePopup = () => {
    setIsPopupOpen(!isPopupOpen); // Alterna o estado do popup ao clicar no ícone Dashboard
  };

  return (
    <div className="menu-top">
      {/* Renderiza o popup se isPopupOpen for verdadeiro */}
      {isPopupOpen && <Popup />}
      <div className="icon-buttons">
        {/* Adiciona um evento de clique para o ícone Dashboard */}
        <a href="/dashboard" className="icon-dashboard" onClick={togglePopup}>
          <FaChartBar className="icon-dashboard" />
        </a>
        <a href="/star" className="icon-star">
          <FaStar className="icon-star" />
        </a>
        <a href="/money" className="icon-money">
          <FaMoneyBill className="icon-money" />
        </a>
        <a href="/calendar" className="icon-calendar">
          <FaCalendarAlt className="icon-calendar" />
        </a>
      </div>
    </div>
  );
};

export default Menu;
